import { useState } from "react";
import { colors } from "../locales/colors";
import { LogoImg } from "../locales/images/logo";
import { TitleImg } from "../locales/images/title";
import { pl } from "../locales/languages/pl";
import { Button, LoginButton } from "../styles/Buttons";
import { Constants } from "../styles/Constants";
import {
  HeaderBox,
  LoginBox,
  LogoBox,
  TitleTxt,
  LogoSubBox,
  SearchHiddenHandle,
} from "../styles/Header";
import {
  MainTitleText,
  IrishText,
  SerifTextS,
  SerifText,
} from "../styles/TextStyles";
import { MenuButton } from "./buttons/MenuButton";
import { MenuHidden } from "./MenuHidden";
import { Search } from "./Search";

export const Header = ({ filter, setFilter }: any) => {
  const [isOpen, setIsOpen] = useState(false);
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <HeaderBox>
      <Search filter={filter} setFilter={setFilter}></Search>
      <LogoBox>
        <LogoSubBox onClick={() => console.log("SIKKKKKE")}>
          <LogoImg size={"42px"} />
        </LogoSubBox>
      </LogoBox>
      <TitleTxt>
        <TitleImg />
      </TitleTxt>
      <LoginBox>
        <MenuButton />
      </LoginBox>
      <SearchHiddenHandle theme={isOpen} />
      <MenuHidden isOpen={menuOpen} setIsOpen={setMenuOpen} />
    </HeaderBox>
  );
};
